setData();
function setData() {
    fetch(eth)
    .then(function(response) {
        if (response.status !== 200) {
            console.log(`Looks like there was a problem. Status code: ${response.status}`);
            return;
        }
        response.json().then(function(data) {

            console.log(data);
            data = JSON.parse(data);

            const node_num = document.getElementById("eth_node_num");
            node_num.innerText = data.num_node;

            const edge_num = document.getElementById("eth_edge_num");
            edge_num.innerText = data.num_edge;

            const scc_num = document.getElementById("eth_scc_num");
            scc_num.innerText = data.num_conn_comp;

            const lcc_num = document.getElementById("eth_lcc_num");
            lcc_num.innerText = data.largest_comp;

            const density = document.getElementById("eth_density_num");
            density.innerText = Math.round(data.density * 100000) / 100000;

            const triangles = document.getElementById("eth_triangle_num");
            triangles.innerText = Math.round(data.triangles * 100000) / 10000;

            const trans = document.getElementById("eth_trans");
            trans.innerText = data.transitivity;
        });
    })

    .catch(function(error) {
        console.log("Fetch error: " + error);
    });

}


